def choose_random_word(difficulty=0):
    word_list = list(words)

    if difficulty == 1:
        # 5 MINIMUL
        word_list = [word for word in words if len(word) > 5]
    elif difficulty == 2:
        # 10 MINIMUM
        word_list = [word for word in words if len(word) > 10]

    return random.choice(word_list)
